import React, { Component } from 'react';
import './App.css';

import Header from './components/Header'
import Cards from './components/cards';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <div className="container-fluid">
          <div className="row">
            <div className="col-auto"><Cards img="https://images.pexels.com/photos/2067659/pexels-photo-2067659.jpeg?cs=srgb&dl=beautiful-environment-idyllic-2067659.jpg&fm=jpg" title= "Title" text="text" /></div>
            <div className="col-auto"><Cards img="https://images.pexels.com/photos/2067659/pexels-photo-2067659.jpeg?cs=srgb&dl=beautiful-environment-idyllic-2067659.jpg&fm=jpg" title= "Title" text="text" /></div>
            <div className="col-auto"><Cards img="https://images.pexels.com/photos/2067659/pexels-photo-2067659.jpeg?cs=srgb&dl=beautiful-environment-idyllic-2067659.jpg&fm=jpg" title= "Title" text="text" /></div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
